void Dict::LoadDefault()
{
   unsigned int i = 0;
   DICT_ENTRY n = DICOMV3DataDict[i];
   while( n.name != 0 )
   {  
      Tag t(n.group, n.element);
      DictEntry e( n.name, n.vr, n.vm );
      AddDictEntry( t, e );
      n = DICOMV3DataDict[++i];
   }
   //Tag t(0, 0);
   //DictEntry e("", VR::INVALID, VM::VM0);
   //AddDictEntry( t, e );
}

